[[package]]
name = "blacksheep"
version = "1.2.2"
summary = "Fast web framework and HTTP client for Python asyncio"
dependencies = [
    "Jinja2~=3.0.2",
    "cchardet~=2.1.7",
    "certifi>=2020.12.5",
    "essentials-openapi<1.0,>=0.1.4",
    "essentials<2.0,>=1.1.4",
    "guardpost~=0.0.9",
    "httptools<0.4,>=0.2",
    "itsdangerous~=2.0.1",
    "python-dateutil~=2.8.2",
    "rodi~=1.1.1",
]

[[package]]
name = "cchardet"
version = "2.1.7"
summary = "cChardet is high speed universal character encoding detector."

[[package]]
name = "certifi"
version = "2021.10.8"
summary = "Python package for providing Mozilla's CA Bundle."

[[package]]
name = "essentials"
version = "1.1.4"
summary = "General purpose classes and functions, reusable in any kind of Python application"

[[package]]
name = "essentials-openapi"
version = "0.1.6"
summary = "Classes to generate OpenAPI Documentation v3 and v2, in JSON and YAML"
dependencies = [
    "PyYAML==5.4.1",
    "essentials>=1.1.4",
]

[[package]]
name = "guardpost"
version = "0.0.9"
summary = "Basic framework to handle authentication and authorization in any kind of Python application."

[[package]]
name = "httptools"
version = "0.3.0"
requires_python = ">=3.5.0"
summary = "A collection of framework independent HTTP protocol utils."

[[package]]
name = "itsdangerous"
version = "2.0.1"
requires_python = ">=3.6"
summary = "Safely pass data to untrusted environments and back."

[[package]]
name = "Jinja2"
version = "3.0.3"
requires_python = ">=3.6"
summary = "A very fast and expressive template engine."
dependencies = [
    "MarkupSafe>=2.0",
]

[[package]]
name = "MarkupSafe"
version = "2.0.1"
requires_python = ">=3.6"
summary = "Safely add untrusted strings to HTML/XML markup."

[[package]]
name = "python-dateutil"
version = "2.8.2"
requires_python = "!=3.0.*,!=3.1.*,!=3.2.*,>=2.7"
summary = "Extensions to the standard Python datetime module"
dependencies = [
    "six>=1.5",
]

[[package]]
name = "PyYAML"
version = "5.4.1"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*, !=3.5.*"
summary = "YAML parser and emitter for Python"

[[package]]
name = "rodi"
version = "1.1.1"
summary = "Implementation of dependency injection for Python 3"

[[package]]
name = "six"
version = "1.16.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*"
summary = "Python 2 and 3 compatibility utilities"

